INSERT INTO `jyxt_text` VALUES (1,'guanyuwomen','公司简介','<p>公司简介&nbsp;Company Profile</p>\r\n<p>&nbsp;八爷源码（81YM.COM）成立于2017年，是全球领先的金融数字资产科技服务商，并获得多家基金、资本投资。总部位于菲律宾，并在亚太、欧洲、南美、中东和北非等多地设有办事处。在全球拥有金融专业和IT专业的员工超过500人。</p>\r\n<p>Blesinex自2017年成立以来，通过利用区块链去中心化的底层技术，结合传统金融科技的流通算法，解决了同时大量交易和结算数据产生的并</p>\r\n<p>发问题， 建立了业内无法比拟的技术壁垒。目前，blesintex已拥有超过数十万vip客户，为全上百个国家的用户提供服务，已经成长为一家大规模且制度完善的国际性金融科技服务商，并成为名副其实的行业领导者。</p>\r\n<p>Blesintex为客户提供快速便捷的多种数字资产流通服务。为了优化客户的操作体验，我们利用先进的数据获取技术提供优质的报价和执行速度以及最有竞争力的使用操作条件。</p>','','','','0000-00-00 00:00:00'),(2,'shangjiashenqing','商家申请','<p>www.81ym.com</p>','','','','0000-00-00 00:00:00'),(3,'yonghuxieyi','用户协议','<p>&nbsp;</p>\n<h1><strong>B</strong><strong>lesintex</strong><strong>用户协议</strong></h1>\n<p>本协议及附加协议适用于访问和使用由blesinex国际公司提供的任何服务，包括但不限于网站www.blesintex.com（以下简称&ldquo;BLEX&rdquo;、&ldquo;本公司&rdquo;、&ldquo;我们&rdquo;或&ldquo;本网站&rdquo;）以及移动应用程序和交易所服务（统称为&ldquo;本服务&rdquo;）。blesintex国际有限公司是一家根据新加坡相关法律成立的公司，www.blesintex.com网站由该公司所有并运营。BLEX网站是一个提供数字货币交易和相关服务的专业性平台。</p>\n<p><strong>用户确认并承诺：</strong><br /><strong>本人已仔细阅读服务协议（以下简称为&ldquo;本协议&rdquo;）。通过点击&ldquo;注册&rdquo;按钮或通过访问或使用本服务，即表示同意遵守本协议及所有附加协议。</strong>&nbsp;本协议内容包括本协议正文以及BLEX已经发布的或将来可能发布的各类规则、声明、说明等。所有规则、声明、说明等均为协议不可分割的一部分， 与协议正文具有同等法律效力。如签订其他有关本网站所提供的产品的相关协议不会影响本协议的生效。如用户代表任何机构使用本服务，您声明并保证 （a）该机构是符合当地法律法规的合法机构，（b）用户有权代表该机构接受本协议。如果违反本协议，该机构同意对用户的行为负责。<br />BLEX保留随时更改或修改本协议中所含内容的权利，包括但不限于本网站的任何政策或准则。任何更改会在发布网站更新后或声明更改后立即生效。如果您不同意本协议，请立即停止使用本网站。我们希望您经常回顾本协议，以确保您了解适用于您访问和使用本服务的协议和条件。 本协议不涉及BLEX用户与其他用户之间因数字货币交易而产生的法律关系及法律纠纷。</p>\n<p><strong>风险提示：</strong><br /><strong>1、基于数字货币交易本身所存在的极大风险，用户在本网站进行数字交易前，应充分了解数字货币本身的特点、交易机制及价格波动等。同时， 因法律及政策对数字货币交易的规范及管理，数字货币交易可能会受此影响而随时被暂停或禁止，进行数字货币交易具有较大风险，交易或持有数字 货币很有可能会造成您的损失。</strong><strong>BLEX</strong><strong>将不对此承担任何责任。因此，您应根据自己的财务状况，仔细考虑是否要交易数字货币或相关衍生品及使用杠杆。</strong><br /><strong>2、</strong><strong>BLEX</strong><strong>不能保证数字货币市场的有序稳定。您应该在数字货币（以及任何其他资产）交易中保持谨慎。价格会随时波动。由于价格波动， 您可能会有大额的盈利或亏损。任何数字货币或交易头寸都可能发生大幅度波动，甚至可能变得毫无价值。</strong><br /><strong>3、在使用本