有权决定免费推广期的终止。</strong><br /><strong>七、协议的终止</strong><br />1、本网站有权依据本协议约定注销您的本网站账号，本协议于账号注销之日终止。<br />2、本网站有权依据本协议约定终止全部本网站服务，本协议于本网站全部服务终止之日终止。<br />3、本协议终止后，您无权要求本网站继续向其提供任何服务或履行任何其他义务，包括但不限于要求本网站为您保留或向您披露其原本网站账号中的任何信息， 向您或第三方转发任何其未曾阅读或发送过的信息等。<br />4、本协议的终止不影响守约方向违约方要求其他责任的承担。<br />八、争议解决<br /><strong>本协议全部内容均为根据</strong><strong>新加坡相关</strong><strong>法律订立的合同，其成立、解释、内容及执行均适用</strong><strong>新加坡</strong><strong>相关法律规定；任何因或与本协议约定的服务有关而产生的索赔或诉讼，都应依照</strong><strong>新加坡相关</strong><strong>法律进行管辖并加以解释和执行。为避免疑义，这一条款明确适用于任何针对我们的侵权索赔。用户无条件地获得在</strong><strong>新加坡</strong><strong>进行诉讼和上诉的排他性的管辖权。用户也无条件地同意与本协议款有关的争议或问题或产生的任何索赔请求和诉讼的发生地或法院均排他性得在</strong><strong>新加坡</strong><strong>，如有本网站其他业务对管辖有专门约定从其约定。不方便法院的原则不适用于根据本服务条款所选择的法院。</strong><br /><strong>九、协议的生效和解释</strong><br />本协议于用户点击BLEX注册页面的同意注册并完成注册程序、获得BLEX账号和密码时生效，对BLEX和用户均具有法律约束力。这些协议规定了双方就服务内容的完整理解，取代了与之有关的所有先前的理解和沟通。 任何与本协议所规定的内容不一致的其他文件，将不对BLEX具有约束力。 您声明并保证所有披露给BLEX的与本服务协议有关的信息是真实，准确和完整的。<br />如本协议中的某一条款被认定为无效或不可执行，则该条款具有可分割性，本协议其余条款的效力不受影响。<br />本协议中所有的标题仅为行文叙述之用，并不作为扩大或限制该条款的内容解释。</p>\n<p>&nbsp;</p>','','','','0000-00-00 00:00:00'),(4,'falvshenming','法律声明','<p>&nbsp;</p>\n<h1><strong>B</strong><strong>lesintex</strong><strong>法律声明</strong></h1>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Blesintex平台（以下简称&ldquo;BLEX&rdquo;&ldquo;本网站&rdquo;）由blesintex国际有限公司所有并运营。BLEX是一家专业从事数字货币交易的平台（市场），在实际交易 中，BLEX只提供交易结算服务并允许用户提取数字货币，不会实际参与到实际的交易中。</p>\n<p>我们按照法律的要求建立并实施了反洗钱、反恐怖主义融资和贸易经济制裁方案。BLEX根据国家相关法律法规的要求，力推&ldquo;共建网络安全， 共享网络文明&rdquo;的实现，为广大用户提供一个合法、高效、透明、有序的交易平台。</p>\n<h3><strong>一、交易风险提示</strong></h3>\n<p>1、交易和持有数字货币有较高风险，数字货币价格易产生波动，并进而对数字货币投资产生不利影响。用户应了解和理解此投资有可能导致部分损失 或全部损失，所以用户应该以能承受的损失程度来决定投资的金额。此外，除了上述提及过的风险以外，还会有未能预测的风险存在。因此，您应该 根据您的经济状况仔细考虑您是否适合进行交易。</p>\n<p>2、因各国法律、法规和规范性文件的制定或者修改，数字货币交易随时可能被暂停、或被禁止。</p>\n<p>3、用户参与数字货币交易，应当自行控制风险，评估数字货币投资价值和投资风险，承担损失全部投资的经济风险。</p>\n<p>&nbsp;</p>\n<p>4、BLEX不参与用户的任何交易，仅作为用户获取数字货币信息、寻找交易方、就数字货币的交易进行协商及开展交易的平台，故用户应自行谨慎 判断确定相关数字货币及/或信息的真实性、合法性和有效性，并自行承担因此产生的责任与损失。</p>\n<h3><strong>二、用户信息保护</strong></h3>\n<p>1、用户在浏览BLEX网站或使用其提供的服务时，基于为用户提供的服务本网站有权保存、使用用户的个人信息资料（包括但不限于进行编辑、 连结、重制、内部及关联企业的传递等）。BLEX会对所收集的个人信息严格保密，并会采取适当的技术措施和其它必要措施，防止相关个人信息资料泄漏和丢失。</p>\n<p>2、BLEX在委托第三方从事网站维护、数据分析、市场调研及其它类似服务时，需要了解用户的部分个人信息资料。第三方只能在其服务范围内 获知用户的个人信息资料，且不得以服务之外的任何目的使用。</p>\n<h3><strong>三、知识产权保护</strong></h3>\n<p>BLEX拥有本网站内容及资源的知识产权,受国家知识产权保护,享有对本网站各种协议、声明的修改权。BLEX未向任何第三方转让本网站或其中 的任何内容及相关的任何权益或所有权，擅自使用本网站任何内容、服务或资料的，构成对本网站的侵权，且可能触犯著作权、商标、专利或 其他方面的法律法规，BLEX保留对任何侵权第三方（包括单位或个人等）提起法律诉讼的权利。</p>\n<p><strong>四、反洗钱权利与义务</strong></p>\n<p>BLEX遵守和执行法律对于反洗钱的规定，将采用对用户进行严格的用户身份识别制度、客户身份资料和交易记录保存制度，以及大额的和可疑交易报告的制度，履行反洗钱义务。</p>\n<p>1、用户注册、挂失交易密码或者资金密码时，应当提供并上传身份证复印件，BLEX对用户提供的身份证信息进行识别和比对。当有合理的理由 怀疑用户使用虚假身份注册时，BLEX有权拒绝接受用户注册或者注销已经注册的账户。</p>\n<p>2、BLEX参照《金融机构大额交易和可疑交易报告管理办法》的规定，保存大额交易和有洗钱嫌疑的交易记录，在监管机构要求提供大额交易和 可疑交易的记录时，BLEX有权向监管机构提供该交易信息。</p>\n<p>3、BLEX对用户身份信息以及大额交易、可疑交易记录进行保存，依法协助、配合司法机关和行政执法机关打击洗钱活动，依照法律法规的规定 协助司法机关、海关、税务等部门查询、冻结和扣划客户存款。</p>\n<p>4、根据国家反洗钱政策及保障客户资产安全，汇款人姓名必须和实名认证姓名一致。</p>\n<p>5、BLEX将会遵守中国人民银行监管指引的文字和精神，如执行&ldquo;了解您的客户&rdquo;措施，监控可疑活动，报告可疑交易，并与当地偶尔要求查询交易信息的有关部门进行合作。</p>\n<h3><strong>五、责任限制与免责</strong></h3>\n<p>1、用户了解并同意，在任何情况下，BLEX不就以下各事项承担责任：</p>\n<p>（1）交易的损失；</p>\n<p>（2）交易利润或合同损失；</p>\n<p>（3）业务中断；</p>\n<p>（4）信息的损失；</p>\n<p>（5）数据的损坏或损失；</p>\n<p>（6）数字货币消亡或退出市场；</p>\n<p>2、在公安机关、法院、工商行政管理局等公权力机关出示符合要求的调查依据要求BLEX配合对指定用户进行调查时或采取其他强制措施时，BLEX&nbsp;将按照有关公权力机关的要求进行相应的操作，因此而给用户带来的一切损失，由用户本人承担，BLEX不承担任何责任。如该行为给BLEX带来 商誉或经济损失的，BLEX保留对该行为的法律追诉权。</p>\n<p>3、BLEX旨在为广大用户搭建优质的数字货币交易平台，提供优质的数字货币交易服务。如用户利用BLEX开展任何违反法律的行为，BLEX&nbsp;将严格按照法律规定将相关线索及证据移交至公安司法机关。BLEX对用户的行为不承担任何连带责任。</p>\n<p>4、凡以任何方式登录或使用（包括直接使用及间接使用）BLEX，均视为对本声明的接受与认可。本声明内容根据相关法律订立， 对本声明的内容将根据相关法律进行解释与适用。</p>\n<p>&nbsp;</p>','','','','0000-00-00 00:00:00'),(5,'yinsitiaokuan','隐私条款','<p><strong>隐私政策</strong><br /><br /><strong>1.守法</strong><br /><br />blesintex<strong>遵守国家相关法令，指针及规范。</strong><br /><br /><strong>2.使用目的</strong><br /><br /><strong>本公司为下列目的使用客户的个人信息：</strong><br /><br /><strong>1.提供并完善本公司的产品或服务；</strong><br /><br /><strong>2.通知本公司的产品、服务或活动；</strong><br /><br /><strong>3.为扩大本公司的产品或服务的范围或完善其质量等而开展营销、调查或分析；</strong><br /><br /><strong>4.为本公司的服务提供维护或支持；</strong><br /><br /><strong>5.通知本公司与所提供服务有关的使用条款、政策等（&ldquo;条款&rdquo;）发生的修订；</strong><br /><br /><strong>6.处理就本公司的服务而言违反条款的行为；</strong><br /><br /><strong>7.验证用户在金融机构持有的帐户；</strong><br /><br /><strong>8.验证对用户在金融机构所持帐户的转账；</strong><br /><br /><strong>9.在紧急情况下沟通。</strong><br /><br /><strong>10.任何其他与上述目的有关的目的。</strong><br /><br /><strong>3.限制使用</strong><br /><br /><br /><br /><strong>未经相关客户同意，本公司不得超出就实现使用目的而言必要的范围使用个人信息，但法案或其他法律或法规允许的情况除外；但是，，该规定不适用于下列情况：</strong><br /><br /><strong>1.根据法律法规的规定使用个人信息；</strong><br /><br /><strong>2.使用个人信息对于保护个人的生命、身体或财产而言是必要的，且难以获得相关客户的同意；</strong><br /><br /><strong>3.使用个人信息对于改善公众健康或促进孩子们的身心健康成长而言是非常必要的，且难以获得相关客户的同意；</strong><br /><br /><strong>4.使用个人信息对于与国家政府、地方政府或受委托执行法律法规规定事务的个人或实体而言是必要的，且获取相关客户的同意可能会妨碍执行相关事务。</strong><br /><br /><br /><br /><strong>4.安全控制</strong><br /><br /><strong>本公司充分并恰当地监督本公司的员工，以确保安全控制个人信息以应对丢失、毁坏、篡改或泄露风险。本公司委托第三方处理全部或部分个人信息时，本公司充分并恰当地监督第三方，以确保安全控制个人信息。</strong><br /><br /><br /><br /><strong>5.提供给第三方</strong><br /><br /><strong>除非法案或其他法律法规允许披露，否则未经相关客户预先同意，本公司不会把个人信息提供给第三方；但是，下列情况不得视作本公司把个人信息提供给第三方：</strong><br /><br /><strong>1.本公司委托第三方在就实现使用目的而言必要的范围内处理个人信息；</strong><br /><br /><strong>2.因业务在合并或其他活动中易主而提供个人信息。</strong><br /><br /><br /><br /><strong>6.披露</strong><br /><br /><strong>如果客户根据法案的规定要求本公司披露个人信息，本公司应先确认请求是由负责人提出的，然后立即向客户披露个人信息（如果本公司没有这些个人信息，本公司应向客户通知相关情况）；但是，根据法案或其他法律或法规的规定，本公司没有义务披露这些个人信息时，该规定不适用。</strong><br /><br /><br /><br /><strong>7.更正，等等</strong><br /><br /><strong>如果客户根据法案的规定，以个人信息与事实相反为理由要求本公司更正、添加或删除个人信息，本公司应先确认请求是由负责人提出的，然后立即在就实现使用目的而言必要的范围内开展必要的调查，然后根据调查结果更正、添加或删除个人信息并向客户通知相关情况（本公司决定不执行更正、添加或删除时，本公司应向客户通知相关情况）；但是，根据法案或其他法律法规的规定，本公司没有义务执行更正、添加或删除时，该规定不适用。</strong><br /><br /><br /><br /><strong>8.停止使用，等等</strong><br /><br /><strong>如果客户根据法案的规定，以本公司对个人信息的处理超越了提前公开宣布的使用目的或以欺骗或其他不正当手段获取个人信息为理要求本公司停止使用或删除个人信息，且调查证明该请求是合理的，则本公司应先确认请求是由负责人提出的，然后立即停止使用或删除个人信息并向客户通知相关情况；但是，根据法案或其他法律法规的规定，本公司没有义务停止使用或删除个人信息时，该规定不适用。</strong><br /><br /><br /><br /><strong>9.使用信息记录程序及其他技术</strong><br /><br /><strong>本公司提供的服务可能采用信息记录程序或类似的技术。这些技术帮助本公司了解本公司服务的使用状况等并持续完善服务。用户想禁用信息记录程序时，用户可以更改网络浏览器设置来禁用信息记录程序。请注意，信息记录程序禁用后，用户将不能继续使用某些部分的服务。</strong><a href=\"http://p.qiao.baidu.com/cps/chat?siteId=13019226&amp;userId=27236031\"><br /></a></p>\n<p>&nbsp;</p>','','','','0000-00-00 00:00:00'),(6,'gonggao',NULL,NULL,NULL,NULL,NULL,NULL);
