CREATE TABLE `jyxt_user_id_card` (
  `id` int(16) NOT NULL AUTO_INCREMENT,
  `user_id` int(16) DEFAULT NULL,
  `id_card_face_url` varchar(128) DEFAULT NULL COMMENT '身份证正面网络地址',
  `id_card_back_url` varchar(128) DEFAULT NULL COMMENT '身份证反面网络地址',
  `address` varchar(128) DEFAULT NULL COMMENT '身份证地址',
  `birth` varchar(64) DEFAULT NULL COMMENT '出生年月日',
  `sex` varchar(8) DEFAULT NULL COMMENT '性别',
  `name` varchar(64) DEFAULT NULL COMMENT '姓名',
  `nationality` varchar(64) DEFAULT NULL COMMENT '民族',
  `num` varchar(64) DEFAULT NULL COMMENT '身份证编号',
  `face_request_id` varchar(64) DEFAULT NULL COMMENT '正面请求ID',
  `back_request_id` varchar(64) DEFAULT NULL COMMENT '反面请求ID',
  `start_date` varchar(32) DEFAULT NULL COMMENT '开始时间',
  `end_date` varchar(32) DEFAULT NULL COMMENT '结束时间',
  `issue` varchar(64) DEFAULT NULL COMMENT '签发地址',
  `add_time` datetime DEFAULT NULL,
  `is_delete` int(1) DEFAULT '0' COMMENT '是否删除 1是  0否',
  `is_auth` int(1) DEFAULT '0' COMMENT '是否审核 1是 0否',
  `is_read` int(1) DEFAULT '0',
  `message_zh` varchar(256) DEFAULT NULL COMMENT '中文驳回原因',
  `message_en` varchar(256) DEFAULT NULL COMMENT '英文驳回原因',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='用户身份证';
